import React from 'react';

const Admin = () => {
    return (
        <div className="page-products container">
            <div>
                <h3>Admin</h3>
            </div>
            <div>
                <button>Quản lý sản phẩm</button>
                <button>Quản lý loại sản phẩm</button>
            </div>
        </div>
    );
}

export default Admin;
